	public void createHtmlToexport(String html, String dest) {
		OutputStream outputStream = null;
		try {
			File file = new File(dest);
			String directoryPath = file.getCanonicalPath().substring(0,
					file.getCanonicalPath().lastIndexOf(File.separator));
			File directory = new File(directoryPath);
			if (!directory.exists())
				directory.mkdirs();
			outputStream = new FileOutputStream(file);
			IOUtils.write(html, outputStream, StandardCharsets.UTF_8);
		} catch (IOException e) {
			logger.error(e.getMessage());
		} finally {
			if (outputStream != null)
				try {
					outputStream.close();
				} catch (IOException e) {
					logger.error(e.getMessage());
				}
		}
	}

	public void generatePDFFromHtml(String src, String dest) {
		try {
			File fuente = new File(src);
			File destino = new File(dest);			
			HtmlConverter.convertToPdf(fuente, destino);
			if(!fuente.delete()){
				logger.error("ERROR generatePDFFromHtml, No se pudo eliminar el archivo fuente");
			};
		} catch (IOException e) {
			logger.error(e.getMessage());
		}
	}

