	public void obtenerDatosContacto(RadicacionSolicitudPDFDTO persona, FormularioParteDTO fParte) {
		String direccion = "", pais = "", ciudad = "", telefono = "", email = "", celular = "", email2 = "", email3= "";
		if (fParte.getLstUbicacion() != null)
			for (UbicacionDTO ubicacion : fParte.getLstUbicacion()) {
				direccion += ubicacion.getDireccion() + ". ";
				pais += (ubicacion.getPais() != null ? ubicacion.getPais().getNombre() + ". " : "");
				ciudad += (ubicacion.getCiudad() != null ? ubicacion.getCiudad().getNombre() + ". " : "");
				if (ciudad.isEmpty()) {
					ZonaGeografica ciudadUbicacion = manejadorZonaGeografica.buscar(ubicacion.getIdZonaGeografica());
					if (ciudadUbicacion != null) {
						ciudad += ciudadUbicacion.getNombre() + ". ";
						if (pais.isEmpty() && ciudadUbicacion.getZonaGeografica() != null
								&& ciudadUbicacion.getZonaGeografica().getZonaGeografica() != null) {
							pais += ciudadUbicacion.getZonaGeografica().getZonaGeografica().getNombre() + ". ";
						}
					}
				}
			}
		persona.setDireccion(!direccion.isEmpty() ? direccion : NO_INFORMA);
		persona.setPais(!pais.isEmpty() ? pais : NO_INFORMA);
		persona.setCiudad(!ciudad.isEmpty() ? ciudad : NO_INFORMA);
		if (fParte.getTelefonos() != null)
			for (TelefonoDTO tel : fParte.getTelefonos()) {				
				 if(tel.getTipoTelefono()!= null && tel.getTipoTelefono().equals(UtilDominios.TIPO_TELEFONO_CELULAR)) {
		            	celular = tel.getNumero();
		            	//Se remplazan todos los caracteres, solo se aceptan digitos, si la longitud es mayor a 10 se toman los ultimos 10 digitos
		            	celular = celular.replaceAll("[^\\d.]", "");
		            	if(celular.length() > 10) {
		            		 celular = celular.substring(celular.length()-10, celular.length()- 1);
		            	}
		               	
		            	persona.setCelular(celular);
		               	 
		         }else {
		        	 telefono += tel.getNumero() + ". ";
		         }
		}
		persona.setTelefono(!telefono.isEmpty() ? telefono : NO_INFORMA);
		persona.setCelular(!celular.isEmpty() ? celular : NO_INFORMA);
		if (fParte.getCorreosElectronicos() != null) {			
			for (CorreoElectronicoDTO correo : fParte.getCorreosElectronicos()) {
				if(email!=null && !email.equals("")) {
					if(email2!=null && !email2.equals("")) {
						email3 += correo.getDireccion()+ ". ";
					}else {
						email2 = correo.getDireccion();
					}
				}else {
					email = correo.getDireccion();
				}
			}
		}
		persona.setEmail(!email.isEmpty() ? email : NO_INFORMA);
		persona.setEmail2(!email2.isEmpty() ? email : NO_INFORMA);
		persona.setEmail3(!email3.isEmpty() ? email : NO_INFORMA);
		
	}

	public void obtenerInformacionBasica(RadicacionSolicitudPDFDTO persona, FormularioParteDTO fParte) {
		String nombre = (fParte.getPrimerNombre() != null ? fParte.getPrimerNombre() + " " : " ")
				+ (fParte.getSegundoNombre() != null ? fParte.getSegundoNombre() + " " : " ")
				+ (fParte.getPrimerApellidoORazonSocial() != null ? fParte.getPrimerApellidoORazonSocial() + " " : " ")
				+ (fParte.getSegundoApellido() != null ? fParte.getSegundoApellido() : "");

		persona.setNombre(obtenerValor(nombre));
		persona.setTipoIdentificacion(
				fParte.getTipoIdentificacion() != null ? obtenerValor(fParte.getTipoIdentificacion().getNombre())
						: NO_INFORMA);
		persona.setNumeroIdentificacion(obtenerValor(fParte.getNumeroIdentificacion()));

		if ((fParte.getCiudadIdentificacionTexto() == null || fParte.getCiudadIdentificacionTexto().isEmpty())
				&& fParte.getCiudadIdentificacion() != null) {
			ZonaGeografica ciudadIdentificacion = manejadorZonaGeografica
					.buscar(fParte.getCiudadIdentificacion().getIdZonaGeografica());
			persona.setCiudadIdentificacion(
					ciudadIdentificacion != null ? ciudadIdentificacion.getNombre() : NO_INFORMA);
		} else {
			persona.setCiudadIdentificacion(obtenerValor(fParte.getCiudadIdentificacionTexto()));
		}

		if (fParte.getNacionalidad() != null && !fParte.getNacionalidad().isEmpty()
				&& fParte.getNacionalidad().matches(REG_EXP_NUMEROS)) {
			ZonaGeografica ciudadNacionalidad = manejadorZonaGeografica.buscar(fParte.getNacionalidad());
			persona.setNacionalidad(ciudadNacionalidad != null ? ciudadNacionalidad.getNombre() : NO_INFORMA);
		} else {
			persona.setNacionalidad(obtenerValor(fParte.getNacionalidad()));
		}

		persona.setSexo(fParte.getTipoSexo() != null ? obtenerValor(fParte.getTipoSexo().getNombre()) : NO_INFORMA);
		persona.setFechaNacimiento(
				fParte.getFechaNacimiento() != null && !fParte.getFechaNacimiento().toString().isEmpty()
						? UtilOperaciones.formatearFechaReporte(fParte.getFechaNacimiento())
						: NO_INFORMA);
	}

