	public Calendar fechaHoy() {
		Calendar cal = Calendar.getInstance();
		cal.setTime(new Date());
		cal.set(Calendar.HOUR_OF_DAY, 0);
		cal.set(Calendar.MINUTE, 0);
		cal.set(Calendar.SECOND, 0);
		cal.set(Calendar.MILLISECOND, 0);
		return cal;
	}

	public static void concatPDFs(List<InputStream> streamOfPDFFiles, OutputStream outputStream, boolean paginate) {

		Document document = new Document();
		try {
			PdfWriter writer = PdfWriter.getInstance(document, outputStream);

			document.open();
			PdfContentByte cb = writer.getDirectContent();

			PdfImportedPage page;

			for (InputStream pdf : streamOfPDFFiles) {
				PdfReader pdfReader = new PdfReader(pdf);
				int pageOfCurrentReaderPDF = 0;
				while (pageOfCurrentReaderPDF < pdfReader.getNumberOfPages()) {

					Rectangle rectangle = pdfReader.getPageSizeWithRotation(1);
					document.setPageSize(rectangle);
					document.newPage();

					pageOfCurrentReaderPDF++;
					page = writer.getImportedPage(pdfReader, pageOfCurrentReaderPDF);
					switch (rectangle.getRotation()) {
					case 0:
						cb.addTemplate(page, 1f, 0, 0, 1f, 0, 0);
						break;
					case 90:
						cb.addTemplate(page, 0, -1f, 1f, 0, 0, pdfReader.getPageSizeWithRotation(1).getHeight());
						break;
					case 180:
						cb.addTemplate(page, -1f, 0, 0, -1f, 0, 0);
						break;
					case 270:
						cb.addTemplate(page, 0, 1.0F, -1.0F, 0, pdfReader.getPageSizeWithRotation(1).getWidth(), 0);
						break;
					default:
						break;
					}
					if (paginate) {
						cb.beginText();
						cb.getPdfDocument().getPageSize();
						cb.endText();
					}
				}
				pageOfCurrentReaderPDF = 0;
			}
			outputStream.flush();
			document.close();
			outputStream.close();
		} catch (Exception e) {
			logger.error(e.getMessage());
		} finally {
			if (document.isOpen())
				document.close();
			try {
				if (outputStream != null)
					outputStream.close();
			} catch (IOException ioe) {
				logger.error(ioe.getMessage());
			}
		}
	}

	public void merge(String dest, String name, String name2, String merge) {
		try {
			List<InputStream> pdfs = new ArrayList<InputStream>();
			pdfs.add(new FileInputStream(dest + name));
			pdfs.add(new FileInputStream(dest + name2));
			OutputStream output = new FileOutputStream(dest + merge);
			concatPDFs(pdfs, output, true);

			File file = new File(dest + name);
			file.delete();

			File file2 = new File(dest + name2);
			file2.delete();
		} catch (Exception e) {
			logger.error(e.getMessage());
		}
	}

	public void mergeSinBorrado(Document document, PdfContentByte cb, PdfWriter writer, String dest,
			OutputStream output) throws Exception {
		concatPDF(document, cb, writer, new FileInputStream(dest), output, true);
		File file = new File(dest);
		file.delete();
	}

